import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

import homeScreen from "../../Media/homeScreen.JPG";

const slider = () =>{
  
  return (
  <AwesomeSlider>
    <div> <img src={homeScreen}></img></div>
    <div>2</div>
    <div>3</div>
    <div>4</div>
  </AwesomeSlider>
)

  }


  export default slider;
